import './Header.css'
import { BiUserCircle } from 'react-icons/bi';
import { BiShoppingBag } from 'react-icons/bi';
import * as React from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Button from '@mui/material/Button';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';

const Header = () => {
    const [state, setState] = React.useState({
        top: false,
        left: false,
        bottom: false,
        right: false,
      });

      const toggleDrawer = (anchor, open) => (event) => {
        if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
          return;
        }

        setState({ ...state, [anchor]: open });
      };

      const list = (anchor) => (
        <Box
          sx={{ width: anchor === 'top' || anchor === 'bottom' ? 'auto' : 250 }}
          role="presentation"
          onClick={toggleDrawer(anchor, false)}
          onKeyDown={toggleDrawer(anchor, false)}
        >
          <List>
            {['Inbox', 'Starred', 'Send email', 'Drafts'].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <ListItemIcon>
                    {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
                  </ListItemIcon>
                  <ListItemText primary={text} />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
          <Divider />
          <List>
            {['All mail', 'Trash', 'Spam'].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <ListItemIcon>

                  </ListItemIcon>
                  <ListItemText primary={text} />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
        </Box>
      );
  return (
    <header>
         <div>
        {['left', 'right', 'top', 'bottom'].map((anchor) => (
            <React.Fragment key={anchor}>
            <Button onClick={toggleDrawer(anchor, true)}>{anchor}</Button>
            <Drawer
                anchor={anchor}
                open={state[anchor]}
                onClose={toggleDrawer(anchor, false)}
            >
                {list(anchor)}
            </Drawer>
            </React.Fragment>
        ))}
        </div>
        <div className="container">
            <div className="row py-4 justify-content-between">
                <div className="left col-lg-3 col-5">
                    <img src="data:image/webp;base64," alt="" />
                </div>
                <div className="row center col-lg-6">
                    <div className="all-link">
                        <a href="">Home</a>
                        <a href="">Shop</a>
                        <a className="red" href="">Sale</a>
                        <a href="">Features</a>
                        <a href="">Blog</a>
                        <a href="">About</a>
                        <a href="">Contact</a>
                    </div>
                </div>
                <div className="right col-lg-3 text-end col-5 justify-content-between">
                    <i className="fa-solid fa-circle-user mx-4"></i>
                    <i className="fa-solid fa-bag-shopping second"></i>
                    <i className="fa-solid fa-bars res"></i>
                </div>
            </div>
        </div>
    </header>
  )
}

export default Header
